import React from 'react';
import './nps.mp4';

function Home() {
  return (
    <div>
      <h1>Welcome to the National Park Service Online Tour Guide!</h1>
      <video
        autoPlay
        loop
        muted
        style={{
          position: 'absolute',
          width: '100%',
          left: '50%',
          top: '50%',
          height: '50%',
          objectfit: 'cover',
          transform: 'translate(-50%,-50%)',
          zIndex: '-1',
        }}
      >
        <source src={'./nps.mp4'} type="video/mp4"></source>
      </video>
    </div>
  );
}

export default Home;
